import timedef read(func):    def wrapper(*args):        res = func(*args)        print(res)    return wrapper@readdef hello_to(x):    return f'salom {x}'hello_to('rahmatjon')def write(func):    def wraps(*args):        res = func(*args)        if isinstance(res, int):            with open('return_func', 'w') as file:                file.writelines(f'{func.__name__}: {res}')        else:            with open('return_func', 'w') as file:                ls_str = []                for i in res:                    if isinstance(i, str):                        ls_str.append(i)                    else:                        ls_str.append(str(i))                file.writelines(f"{func.__name__}: {', '.join(ls_str)}")    return wraps@writedef nums(x: int, y: int) -> list:    return list(range(x, y + 1))start = time.time()nums(5, 11)end = time.time()print(start - end)